INSERT INTO `info` VALUES ('15f9c1a3672111e', '习近平和夫人彭丽媛陪同美国总统特朗普和夫人梅拉尼娅参观故宫博物院', '0', '央视网消息（新闻联播）：国家主席习近平和夫人彭丽媛8日陪同来华进行国事访问的美国总统特朗普和夫人梅拉尼娅参观故宫博物院。两国元首夫妇在故宫宝蕴楼茶叙，共同参观故宫前三殿，观看文物修复技艺展示和珍品文物展，并欣赏京剧表演。', '<p><strong>央视网消息</strong>（新闻联播）：国家主席习近平和夫人彭丽媛8日陪同来华进行国事访问的美国总统特朗普和夫人梅拉尼娅参观故宫博物院。两国元首夫妇在故宫宝蕴楼茶叙，共同参观故宫前三殿，观看文物修复技艺展示和珍品文物展，并欣赏京剧表演。</p><p>季秋时节，故宫红垣溢彩，黄瓦流光。习近平和夫人彭丽媛在故宫宝蕴楼迎接特朗普和夫人梅拉尼娅。两国元首夫妇互致问候，亲切寒暄，共同步入宝蕴楼落座茶叙。</p><p>宝蕴楼内铭香满室，乐音绕梁，人文渊薮。习近平热烈欢迎特朗普在当选美国总统1周年之际来华进行国事访问，感谢特朗普全家今年4月在海湖庄园的热情接待，祝特朗普夫妇在中国访问愉快。</p><p>习近平强调，特朗普总统此次访华意义重大，不仅为中美两国高度关注，也为世界各国所瞩目。相信在双方的共同努力下，这次访问将取得积极和重要成果。习近平应询向特朗普介绍了中国经济社会发展现状和刚刚闭幕的中共十九大重要成果。</p><p>特朗普感谢中方对他此次访华作出的周到安排，祝贺中共十九大圆满闭幕和习近平再次当选中共中央总书记，称赞中国经济发展取得的成就，期待对中国的国事访问取得成功。</p><p>习近平向特朗普介绍了故宫的历史，指出故宫是了解中国历史文化不可或缺的窗口。随后，习近平夫妇陪同特朗普夫妇前往前三殿参观。两国元首夫妇经内金水桥，穿过太和门，在恢弘庄重的太和殿广场合影。两国元首夫妇沿故宫中轴线，依次参观了太和殿、中和殿、保和殿，体会着三大殿中文名称中蕴含的“和”的中国文化传统。特朗普惊叹故宫建筑群的蔚为壮观，不时兴趣盎然地驻足凝望，仔细品味着朱墙黄瓦、雕梁画栋，更对底蕴深厚、内涵丰富的中国传统文化深表赞叹。</p><p>参观完前三殿后，两国元首夫妇来到故宫文物医院。两国元首夫妇先后观赏了钟表、木器、金属器、陶瓷、纺织品、书画等文物修复技艺展示，现场参与书画修复体验，并共同观看了珍品文物展。两国元首积极评价中美两国在文物修复方面开展的广泛、深入合作。</p><p>红日衔山，华灯初上，两国元首夫妇转入畅音阁，沿途欣赏景泰蓝工艺精品和制作技艺展示并“点蓝”互动，共同欣赏京剧《梨园春苗》、《美猴王》、《贵妃醉酒》三个精彩剧目。来宾们阵阵掌声和声声喝彩不绝于耳。</p><p>参观交流期间，两国元首还就治国理政及中美关系等共同关心的问题交换了看法。</p><p>丁薛祥，杨洁篪等参加上述活动。</p>', '2017-11-08 22:48:04', '2018-01-24 11:15:55');
